CREATE TABLE `eload_order_info` (
  `order_id` int(10) unsigned NOT NULL AUTO_INCREMENT,
  `pay_node` tinyint(3) unsigned NOT NULL DEFAULT '0' COMMENT '组合支付模式记录pay_node=1,纯cod模式',
  `order_group_id` mediumint(11) unsigned NOT NULL DEFAULT '0' COMMENT '组合支付模式下订单组id',
  `order_sn` varchar(20) NOT NULL DEFAULT '0' COMMENT 'order_sn后缀，给worldpay支付来标识重复付款',
  `order_suffix` smallint(3) DEFAULT NULL,
  `user_id` int(10) unsigned NOT NULL DEFAULT '0',
  `order_status` tinyint(1) unsigned NOT NULL DEFAULT '0',
  `consignee` varchar(255) NOT NULL DEFAULT '',
  `country` smallint(5) unsigned NOT NULL DEFAULT '0',
  `province` varchar(255) DEFAULT NULL,
  `city` varchar(255) DEFAULT NULL,
  `address` varchar(255) NOT NULL DEFAULT '',
  `address2` varchar(255) NOT NULL DEFAULT '' COMMENT '地址2',
  `zipcode` varchar(60) NOT NULL DEFAULT '',
  `id_card` varchar(80) DEFAULT '' COMMENT '身份证号',
  `tel` varchar(60) NOT NULL DEFAULT '',
  `email` varchar(130) NOT NULL,
  `postscript` text NOT NULL,
  `shipping_id` tinyint(3) unsigned NOT NULL DEFAULT '0',
  `shipping_name` varchar(120) NOT NULL DEFAULT '',
  `shipping_method` varchar(20) DEFAULT NULL,
  `Tracking_NO` varchar(255) DEFAULT NULL,
  `pay_id` varchar(100) DEFAULT NULL,
  `pay_name` varchar(120) NOT NULL DEFAULT '',
  `yuan_goods_amount` decimal(10,2) DEFAULT '0.00',
  `goods_amount` decimal(10,2) NOT NULL DEFAULT '0.00',
  `coupon_discount_amount` decimal(10,2) NOT NULL DEFAULT '0.00' COMMENT '订单的coupon折扣金额',
  `shipping_fee` decimal(10,2) NOT NULL DEFAULT '0.00',
  `free_shipping_fee` decimal(10,2) NOT NULL DEFAULT '0.00',
  `insure_fee` decimal(10,2) NOT NULL DEFAULT '0.00',
  `formalities_fee` decimal(10,2) NOT NULL DEFAULT '0.00' COMMENT '针对货到付款物流方式用',
  `pay_fee` decimal(10,2) NOT NULL DEFAULT '0.00',
  `order_amount` decimal(10,2) NOT NULL DEFAULT '0.00',
  `multi_order_amount` decimal(10,2) NOT NULL DEFAULT '0.00' COMMENT '多币种订单总金额',
  `order_currency` varchar(5) NOT NULL DEFAULT 'USD' COMMENT '币种',
  `order_rate` decimal(11,6) NOT NULL DEFAULT '1.000000' COMMENT '美元兑换汇率',
  `realpay` decimal(10,2) DEFAULT '0.00' COMMENT 'paypal实际付款',
  `referer` varchar(255) NOT NULL DEFAULT '',
  `add_time` int(10) unsigned NOT NULL DEFAULT '0',
  `pay_time` int(11) NOT NULL DEFAULT '0',
  `shipping_time` int(11) NOT NULL DEFAULT '0',
  `cancel_time` int(10) unsigned NOT NULL DEFAULT '0' COMMENT '取消订单或者是订单退款时间',
  `pay_note` varchar(255) NOT NULL DEFAULT '',
  `tax` decimal(10,2) NOT NULL,
  `Invoice` tinyint(1) NOT NULL DEFAULT '0',
  `promotion_code_youhuilv` varchar(500) DEFAULT '0',
  `promotion_code` varchar(100) DEFAULT NULL,
  `Need_Traking_number` decimal(10,2) DEFAULT '0.00',
  `wj_linkid` int(11) NOT NULL DEFAULT '0',
  `is_dao` int(11) NOT NULL DEFAULT '0',
  `is_ping` int(11) NOT NULL DEFAULT '0' COMMENT '统计屏蔽手机和IPAD',
  `used_point` float DEFAULT '0',
  `point_money` float DEFAULT '0',
  `is_login` tinyint(3) unsigned NOT NULL DEFAULT '0',
  `is_to_erp` tinyint(1) unsigned NOT NULL COMMENT '自动导单用的，默认\n是0，成功导完后的为1',
  `wj_referer` varchar(255) DEFAULT '' COMMENT '订单来源－网站联盟',
  `order_method` tinyint(1) unsigned NOT NULL DEFAULT '1' COMMENT '订单处理方式（1 到货先发，其他退款 ；2 可部分发货，继续等待剩余产品 ；3 等待所有货到齐一起发）',
  `is_display_track_goods` tinyint(1) unsigned NOT NULL DEFAULT '0' COMMENT '是否显示物流单号的商品明细（0:不显示，1：显示）',
  `com_is_fa` tinyint(1) unsigned NOT NULL DEFAULT '1' COMMENT '是否已经发放佣金',
  `com_fa_date` int(11) unsigned NOT NULL COMMENT '佣金发放时间',
  `full_reduce_discount` decimal(10,2) DEFAULT NULL COMMENT '满减金额',
  `buytype` tinyint(1) unsigned DEFAULT '0' COMMENT '订单来源,0:网站;2手机 by fangxin on 2012-12-13 14:33:59',
  `lang` char(12) NOT NULL DEFAULT 'en' COMMENT '下单时所用语种',
  `pay_ip` varchar(15) DEFAULT '' COMMENT '用户付款IP',
  `is_to_oms` tinyint(1) unsigned DEFAULT '0' COMMENT '新自动导单用，默认为0，成功导完后的为1',
  `update_time` timestamp NOT NULL DEFAULT CURRENT_TIMESTAMP ON UPDATE CURRENT_TIMESTAMP COMMENT '记录修改时间',
  `used_wallet` decimal(8,2) DEFAULT '0.00' COMMENT '本单使用电子钱包支付金额',
  `is_order_review` tinyint(1) NOT NULL DEFAULT '0' COMMENT '订单是否评价 1已评价',
  `is_point` tinyint(3) unsigned NOT NULL DEFAULT '0' COMMENT '订单是否已送积分',
  `tax_id` varchar(100) DEFAULT '' COMMENT '个人税号',
  `recieved_time` int(10) DEFAULT '0' COMMENT '到货时间',
  `media_source` varchar(50) NOT NULL DEFAULT '',
  `campagin` varchar(50) NOT NULL DEFAULT '',
  `oms_release_storage` tinyint(1) unsigned NOT NULL DEFAULT '0' COMMENT '未付款订单oms库存状态:0 默认 1 库存释放 2 付款完成重新占用',
  `cod_discount` decimal(10,4) NOT NULL DEFAULT '0.0000' COMMENT 'cod 金额取整',
  `cod_orientation` tinyint(1) NOT NULL DEFAULT '0' COMMENT 'cod 金额取向 0：正常，1向上取整，2，向下取整',
  `order_class` tinyint(1) unsigned NOT NULL DEFAULT '0' COMMENT '1:模拟礼品卡订单0:普通订单',
  `retargeting` varchar(4) DEFAULT 'true' COMMENT '是否推送',
  `pid` varchar(80) DEFAULT '' COMMENT '渠道来源',
  `campaign` varchar(80) DEFAULT '' COMMENT '营销活动',
  `version` varchar(20) DEFAULT '' COMMENT 'APP版本号',
  `date_wj_linkid_created` int(10) NOT NULL DEFAULT '0' COMMENT 'wj_linkid记录时间',
  `postback_id` varchar(200) NOT NULL DEFAULT '' COMMENT 'Affiliate-inhouse 回传来自该平台的订单',
  `pic_url` varchar(255) NOT NULL DEFAULT '' COMMENT '图片地址',
  `user_wish_refund` tinyint(1) NOT NULL DEFAULT '0' COMMENT '用户是否已申请自助退款',
  `pay_platform` tinyint(1) NOT NULL DEFAULT '0' COMMENT '订单付款平台：0 未知(默认),1 web,2 wap ,3 android,4 ios',
  `add_to_cart` tinyint(1) NOT NULL DEFAULT '0' COMMENT '添加商品至购物车标识：0 不可以,1 可以,2 已添加',
  `aff_source` varchar(50) DEFAULT '' COMMENT '联盟平台',
  `aff_extra` text COMMENT '来源其他参数',
  `utm_campaign` varchar(25) DEFAULT '' COMMENT '联盟平台通用参数1',
  `utm_medium` varchar(25) DEFAULT '' COMMENT '联盟平台通用参数2',
  `buy_from` tinyint(1) unsigned NOT NULL DEFAULT '0' COMMENT '订单来源(平台区分) 1web 2wap 3iOS 4Android add by zhousuyang 20161005，但是别加到正式站',
  PRIMARY KEY (`order_id`),
  UNIQUE KEY `order_sn` (`order_sn`),
  KEY `user_id` (`user_id`),
  KEY `shipping_id` (`shipping_id`),
  KEY `pay_id` (`pay_id`),
  KEY `email` (`email`),
  KEY `wj_linkid` (`wj_linkid`),
  KEY `is_to_erp` (`is_to_erp`),
  KEY `is_to_oms` (`is_to_oms`),
  KEY `order_suffix` (`order_sn`,`order_suffix`),
  KEY `wj_linkid_2` (`wj_linkid`,`add_time`),
  KEY `is_order_review` (`is_order_review`),
  KEY `idx_promotion_code` (`promotion_code`),
  KEY `id_card` (`id_card`),
  KEY `pay_time_order_id` (`pay_time`,`order_id`),
  KEY `idx_lang` (`lang`),
  KEY `idx_update_time` (`update_time`),
  KEY `order_class` (`order_class`),
  KEY `idx_oms_order_status` (`oms_release_storage`,`order_status`),
  KEY `idx_order_status` (`order_status`),
  KEY `idx_time_status` (`add_time`,`order_status`),
  KEY `idx_add_time` (`add_time`)
) ENGINE=InnoDB AUTO_INCREMENT=7041422 DEFAULT CHARSET=utf8;
